import React from 'react';

export default class Field extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="labelGroup">
                <label className="fieldTitle">{this.props.FieldTitle}</label>
                {this.props.Input}
            </div>
        )
    }
}
